const DARK_SHOULDER_COLOUR = "#423f3f;";
const WHITE_COMMAND_SHOULDER_COLOUR = "#cbcbcb;";
const WHITE_MEDICAL_BODY = "#cbcbcb;";
const STANDARD_BODY = "#2d2d2d;";
const GREY_PIPING = "#676767;";

const SILVER = "#d7d7d7;";
const GOLD = "#ECAF29;";

export class StoUniformPack extends BaseTngEraUniformPack implements IUniformPack {

    constructor() {
        super(UniformEra.StarTrekOnline);
    }

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male",
                (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StarTrekOnline)
                    + (isEnlistedRank(token.rankIndicator) ? StoUniforms.averageMaleEnlisted : StoUniforms.averageMale),
                    BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female",
                (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StarTrekOnline)
                    + (isEnlistedRank(token.rankIndicator) ? StoUniforms.averageFemaleEnlisted : StoUniforms.averageFemale),
                    BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformVariantSwatches(token: Token) {
        if (DivisionColors.getDivision(UniformEra.StarTrekOnline, token.divisionColor) === Division[Division.Command]
                && token.rankIndicator === Rank.Captain) {

            if (token.bodyType === BodyType.AverageMale) {
                return [
                    new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageMale, BodyType.AverageMale, token)),
                    new Swatch(UniformVariantType.Variant1, "Command Variant", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageMale.replace(DARK_SHOULDER_COLOUR, WHITE_COMMAND_SHOULDER_COLOUR), BodyType.AverageMale, token)),
                ];
            } else {
                return [
                    new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageFemale, BodyType.AverageFemale, token)),
                    new Swatch(UniformVariantType.Variant1, "Command Variant", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageFemale.replace(DARK_SHOULDER_COLOUR, WHITE_COMMAND_SHOULDER_COLOUR), BodyType.AverageFemale, token)),
                ];
            }
        } else if (DivisionColors.isScience(UniformEra.StarTrekOnline, token.divisionColor) && !isEnlistedRank(token.rankIndicator) && !isFlagRank(token.rankIndicator)) {

            if (token.bodyType === BodyType.AverageMale) {
                return [
                    new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageMale, BodyType.AverageMale, token)),
                    new Swatch(UniformVariantType.Variant1, "Medical Variant", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StarTrekOnline) +
                        StoUniforms.averageMale.replace(STANDARD_BODY, WHITE_MEDICAL_BODY).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY),
                        BodyType.AverageMale, token)),
                ];
            } else {
                return [
                    new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StarTrekOnline) + StoUniforms.averageFemale, BodyType.AverageFemale, token)),
                    new Swatch(UniformVariantType.Variant1, "Medical Variant", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StarTrekOnline) +
                        StoUniforms.averageFemale.replace(STANDARD_BODY, WHITE_MEDICAL_BODY).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY),
                        BodyType.AverageFemale, token)),
                ];
            }
        } else {
            return [];
        }
    }

    getUniformAndVariantBody(token: Token) {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        if (token.bodyType === BodyType.AverageMale) {
            let divisionInsignia = "";
            if (division === Division[Division.Command]) {
                divisionInsignia = StoUniforms.deltaSymbolMale.command;
            } else if (division === Division[Division.Science]) {
                divisionInsignia = StoUniforms.deltaSymbolMale.science;
            } else if (division === Division[Division.Operations]) {
                divisionInsignia = StoUniforms.deltaSymbolMale.operations;
            }

            const base = isEnlistedRank(token.rankIndicator) ? StoUniforms.averageMaleEnlisted : StoUniforms.averageMale;
            let uniform = base.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            if (token.variant === UniformVariantType.Variant1 && DivisionColors.isCommand(token.uniformEra, token.divisionColor)) {
                uniform = uniform.replace(DARK_SHOULDER_COLOUR, WHITE_COMMAND_SHOULDER_COLOUR);
            } else if (token.variant === UniformVariantType.Variant1 && DivisionColors.isScience(token.uniformEra, token.divisionColor)) {
                uniform = uniform.replace(STANDARD_BODY, WHITE_MEDICAL_BODY).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
            } else if (isFlagRank(token.rankIndicator)) {
                if (token.rankIndicator === Rank.Admiral) {
                    uniform = uniform.replace(SILVER, GOLD).replace(GREY_PIPING, GOLD).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
                } else {
                    uniform = uniform.replace(GREY_PIPING, SILVER).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
                }
            }

            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.NextGeneration)
                + uniform + divisionInsignia;
        } else {
            let divisionInsignia = "";
            if (division === Division[Division.Command]) {
                divisionInsignia = StoUniforms.deltaSymbolFemale.command;
            } else if (division === Division[Division.Science]) {
                divisionInsignia = StoUniforms.deltaSymbolFemale.science;
            } else if (division === Division[Division.Operations]) {
                divisionInsignia = StoUniforms.deltaSymbolFemale.operations;
            }

            const base = isEnlistedRank(token.rankIndicator) ? StoUniforms.averageFemaleEnlisted : StoUniforms.averageFemale;

            let uniform = base.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            if (token.variant === UniformVariantType.Variant1 && DivisionColors.isCommand(token.uniformEra, token.divisionColor)) {
                uniform = uniform.replace(DARK_SHOULDER_COLOUR, WHITE_COMMAND_SHOULDER_COLOUR);
            } else if (token.variant === UniformVariantType.Variant1 && DivisionColors.isScience(token.uniformEra, token.divisionColor)) {
                uniform = uniform.replace(STANDARD_BODY, WHITE_MEDICAL_BODY).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
            } else if (isFlagRank(token.rankIndicator)) {
                if (token.rankIndicator === Rank.Admiral) {
                    uniform = uniform.replace(SILVER, GOLD).replace(GREY_PIPING, GOLD).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
                } else {
                    uniform = uniform.replace(GREY_PIPING, SILVER).replace(DARK_SHOULDER_COLOUR, STANDARD_BODY);
                }
            }

            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.NextGeneration)
                + uniform + divisionInsignia
        }
    }

    fitPipsToBody(svg: string, bodyType: BodyType) {
        if (bodyType === BodyType.AverageMale) {
            return `<g transform="matrix(1.0037078,0.07226495,0.01499498,0.99738547,-4.0109993,-16.318204)">` + svg + `</g>`;
        } else {
            return svg;
        }
    }

    getRankIndicator(token: Token) {
        switch (token.rankIndicator) {
            case Rank.Captain:
                return this.fitPipsToBody(RankIndicators.collar.captain, token.bodyType);
            case Rank.Commander:
                return this.fitPipsToBody(RankIndicators.collar.commander, token.bodyType);
            case Rank.LtCommander:
                return this.fitPipsToBody(RankIndicators.collar.ltCommander, token.bodyType);
            case Rank.Lieutenant:
                return this.fitPipsToBody(RankIndicators.collar.lieutenant, token.bodyType);
            case Rank.LieutenantJG:
                return this.fitPipsToBody(RankIndicators.collar.lieutenantJG, token.bodyType);
            case Rank.Ensign:
                return this.fitPipsToBody(RankIndicators.collar.ensign, token.bodyType);
            case Rank.Crewman1stClass:
                return this.fitPipsToBody(RankIndicators.collar.crewman1stClass, token.bodyType);
            case Rank.Crewman2ndClass:
                return this.fitPipsToBody(RankIndicators.collar.crewman2ndClass, token.bodyType);
            case Rank.Crewman3rdClass:
                return this.fitPipsToBody(RankIndicators.collar.crewman3rdClass, token.bodyType);
            case Rank.Admiral:
                return this.fitPipsToBody(RankIndicators.collar.admiral, token.bodyType);
            case Rank.ViceAdmiral:
                return this.fitPipsToBody(RankIndicators.collar.viceAdmiral, token.bodyType);
            case Rank.RearAdmiral:
                return this.fitPipsToBody(RankIndicators.collar.rearAdmiral, token.bodyType);
            default:
                return "";
        }
    }

    getRankSwatches() {
        let result = [
            new Swatch(Rank.None, "None", (token) => RankIndicatorCatalog.decorateSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Ensign, "Ensign", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.ensign, Rank.Ensign, token), "Rank.ensign.name"),
            new Swatch(Rank.LieutenantJG, "Lieutenant J.G.", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.lieutenantJG, Rank.LieutenantJG, token), "Rank.lieutenantJG.name"),
            new Swatch(Rank.Lieutenant, "Lieutenant", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.lieutenant, Rank.Lieutenant, token), "Rank.lieutenant.name"),
            new Swatch(Rank.LtCommander, "Lt. Commander", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.ltCommander, Rank.LtCommander, token), "Rank.ltCommander.name"),
            new Swatch(Rank.Commander, "Commander", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.commander, Rank.Commander, token), "Rank.commander.name"),
            new Swatch(Rank.Captain, "Captain", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.captain, Rank.Captain, token), "Rank.captain.name"),
            new Swatch(Rank.Crewman1stClass, "Crewman 1st Class", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.crewman1stClass, Rank.Crewman1stClass, token), "Rank.crewman1stClass.name"),
            new Swatch(Rank.Crewman2ndClass, "Crewman 2nd Class", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.crewman2ndClass, Rank.Crewman2ndClass, token), "Rank.crewman2ndClass.name"),
            new Swatch(Rank.Crewman3rdClass, "Crewman 3rd Class", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.crewman3rdClass, Rank.Crewman3rdClass, token), "Rank.crewman3rdClass.name"),
            new Swatch(Rank.Admiral, "Admiral", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.admiral, Rank.Admiral, token), "Rank.admiral.name"),
            new Swatch(Rank.ViceAdmiral, "Vice Admiral", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.viceAdmiral, Rank.ViceAdmiral, token), "Rank.viceAdmiral.name"),
            new Swatch(Rank.RearAdmiral, "Rear Admiral", (token) => RankIndicatorCatalog.decorateSwatch(RankIndicators.collar.rearAdmiral, Rank.RearAdmiral, token), "Rank.rearAdmiral.name"),
        ];
        return result.filter(s => UniformVariantRestrictions.isRankSupported(s.id as Rank, this.era));
    }


    getBorderLogo(token: Token): string {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        let base = StoInsignia.base;
        if (token.rankIndicator === Rank.Admiral) {
            base = base.replace(SILVER, GOLD);
        }
        if (division === Division[Division.Command]) {
            return base + StoInsignia.command;
        } else if (division === Division[Division.Operations]) {
            return base + StoInsignia.operations;
        } else {
            return base + StoInsignia.science;
        }
    }

    getRankBorderIndicator(token: Token) {
        switch (token.rankIndicator) {
            case Rank.Captain:
                return RankIndicators.border.captain;
            case Rank.Commander:
                return RankIndicators.border.commander;
            case Rank.LtCommander:
                return RankIndicators.border.ltCommander;
            case Rank.Lieutenant:
                return RankIndicators.border.lieutenant;
            case Rank.LieutenantJG:
                return RankIndicators.border.lieutenantJG;
            case Rank.Ensign:
                return RankIndicators.border.ensign;
            case Rank.Crewman1stClass:
                return RankIndicators.border.crewman1stClass;
            case Rank.Crewman2ndClass:
                return RankIndicators.border.crewman2ndClass;
            case Rank.Crewman3rdClass:
                return RankIndicators.border.crewman3rdClass;
            case Rank.Admiral:
                return RankIndicators.border.admiral;
            case Rank.ViceAdmiral:
                return RankIndicators.border.viceAdmiral;
            case Rank.RearAdmiral:
                return RankIndicators.border.rearAdmiral;
            default:
                return "";
        }
    }
    isDivisionColorSupported(token: Token): boolean {
        return true;
    }
}